import React from 'react';

const PropertyCard = ({ cost, propertyName, address, imageUrl }) => {
  return (
    <div className="max-w-sm rounded overflow-hidden shadow-lg">
      <img className="w-full" src={imageUrl} alt="Property" />
      <div className="px-6 py-4">
        <div className="font-bold text-xl mb-2">{propertyName}</div>
        <p className="text-gray-700 text-base">
          <strong>Cost:</strong> ${cost}
        </p>
        <p className="text-gray-00 text-base">
          <strong>Address:</strong> {address}
        </p>
      </div>
    </div>
  );
};

const PropertyList = () => {
  const properties = [
    {
      id: 1,
      cost: 500000,
      propertyName: 'Beautiful Home',
      address: '123 Main St, Cityville',
      imageUrl: 'https://example.com/image1.jpg',
    },
    {
      id: 2,
      cost: 700000,
      propertyName: 'Luxury Apartment',
      address: '456 Oak St, Townsville',
      imageUrl: 'https://example.com/image2.jpg',
    },
    {
      id: 3,
      cost: 900000,
      propertyName: 'Cozy Cottage',
      address: '789 Pine St, Villagetown',
      imageUrl: 'https://example.com/image3.jpg',
    },
  ];

  return (
    <div className="grid grid-cols-3 gap-4">
      {properties.map((property) => (
        <PropertyCard key={property.id} {...property} />
      ))}
    </div>
  );
};

export default PropertyList;
